    // particle animation on top page
    function particleSystem()
    {
        const canvas = document.getElementById('parCanvas')
        const ctx = canvas.getContext('2d')
        canvas.width = 825
        canvas.height = 1461

        class Particle
        {
            constructor(effect, x, y, color)
            {
                this.effect = effect
                this.x = Math.random() * this.effect.width
                this.y = 0
                this.originX = Math.floor(x)
                this.originY = Math.floor(y)
                this.color = color
                this.size = this.effect.gap
                this.vx = 0
                this.vy = 0
                this.ease = 0.15
                this.friction = 0.8
                this.dx = 0
                this.dy = 0
                this.distance = 0;
                this.force = 0
                this.angle = 0
            }
            draw(context)
            {
                context.fillStyle = this.color
                context.fillRect(this.x, this.y, this.size, this.size)
            }
            update()
            {
                this.dx = (this.effect.mouse.x - this.x )
                this.dy = (this.effect.mouse.y - this.y)
                this.distance = this.dx * this.dx + this.dy * this.dy
                this.force = -this.effect.mouse.radius / this.distance

                if(this.distance < this.effect.mouse.radius)
                {
                    this.angle = Math.atan2(this.dy, this.dx)
                    this.vx += this.force * Math.cos(this.angle)
                    this.vy += this.force * Math.sin(this.angle)
                }

                this.x += (this.vx *= this.friction) + (this.originX - this.x) * this.ease
                this.y += (this.vy *= this.friction) + (this.originY - this.y) * this.ease
            }
        }

        class Effect
        {
            constructor(width, height)
            {
                this.width = width
                this.height = height
                this.particleArray = []
                this.image = myImage
                this.centerX = this.width * 0.5
                this.centerY = this.height * 0.5
                this.x = this.centerX - this.image.width * 0.5 -20
                this.y = this.centerY - this.image.height * 0.5 + 205
                this.gap = 3
                this.mouse = {
                    radius: 30000,
                    x: undefined,
                    y: undefined
                }
                window.addEventListener('mousemove', event =>
                {
                    this.mouse.x = event.x *3 -(window.innerWidth * window.innerWidth * .00052) -650
                    this.mouse.y = event.y *2.8 -620
                })
            }
            init(context)
            {
                context.drawImage(this.image, this.x, this.y)
                const pixels = context.getImageData(0, 0, this.width, this.height).data
                for(let y = 0; y < this.height; y += this.gap)
                {
                    for(let x = 0; x < this.width; x+= this.gap)
                    {
                        const index = (y * this.width + x) * 4
                        const red = pixels[index]
                        const green = pixels[index + 1]
                        const blue = pixels[index + 2]
                        const alpha = pixels[index + 3]
                        const color = 'rgb(' + red + ',' + green + ',' + blue + ')'
                        
                        if(alpha > 0)
                        {
                            this.particleArray.push(new Particle(this, x, y, color))
                        }
                    }
                }
            }
            draw(context)
            {
                this.particleArray.forEach(particle => particle.draw(context))
            }
            update()
            {

                this.particleArray.forEach(particle => particle.update())
            }
        }

        const effect = new Effect(canvas.width, canvas.height)
        effect.init(ctx)


        function animate()
        {
            ctx.clearRect(0, 0, canvas.width, canvas.height)
            effect.draw(ctx)
            effect.update()
            
            if(target == 'phone')
            {
                raf.current = window.requestAnimationFrame(animate)
            }
            else
            {
                window.cancelAnimationFrame(raf.current)
            }
        }
        animate()

    }

