// Horror page
export function LookMe()
{
    const svgRef = useRef()
    const target = useGame((state) => state.target)

    // Animation of gradual text display
    function effect()
    {
        var l = Snap(svgRef.current)
        l.clear()
        var count = 1

        for(var n=0; n < 20; n++)
        {
            setTimeout(() =>
            {
                var text = 'Look At Me. Look At Me. Look At Me. Look At Me.'
                var textRandom = ''
                var textTitleContainer = l.text(0, `${5*count}%`, '')
                count++
                var possible = '-+*/|}{[]~\\\":;?/.><=+-_)(*&^%$#@!)}'
                textTitleContainer.attr({
                    fontSize: 100,
                    fontWeight: 700,
                    fontFamily: 'Amatic Sc',
                    fill: '#fff'
                })
                function generateRandomText(i, textRandom)
                {
                    setTimeout(() =>
                    {
                        textTitleContainer.attr({ text: textRandom })
                    }, i*70)
                }
                for(var i=0; i < text.length+1; i++)
                {
                    textRandom = text.substr(0, i)
                    for(var j=i; j < text.length; j++)
                    {
                        textRandom += possible.charAt(Math.floor(Math.random() * possible.length))
                    }
                    generateRandomText(i, textRandom)
                    textRandom = ''
                }
            }, 150 * n)
        }
    }
    useEffect(() =>
    {
        effect()
    }, [target])

    return <div className="lookContainer">
        <svg xmlns="http://www.w3.org/2000/svg" ref={svgRef} className="lookText" viewBox={[0, 0, 840, 1825]} width="840" height="1825" style={{overflow: 'auto'}} /> 

        {/* Effect of shaking latters */}
        <svg xmlns="http://www.w3.org/2000/svg" className="lookEffect" version="1.1" width="0" height="0">
            <defs>
                <filter id="squiggly-0">
                    <feTurbulence className="turbulence" baseFrequency="0.02" numOctaves="3" result="noise" seed="0"/>
                    <feDisplacementMap in="SourceGraphic" in2="noise" scale="18" />
                </filter>
                <filter id="squiggly-1">
                    <feTurbulence className="turbulence" baseFrequency="0.02" numOctaves="3" result="noise" seed="1"/>
                    <feDisplacementMap in="SourceGraphic" in2="noise" scale="24" />
                </filter>
                
                <filter id="squiggly-2">
                    <feTurbulence className="turbulence" baseFrequency="0.02" numOctaves="3" result="noise" seed="2"/>
                    <feDisplacementMap in="SourceGraphic" in2="noise" scale="18" />
                </filter>
                <filter id="squiggly-3">
                    <feTurbulence className="turbulence" baseFrequency="0.02" numOctaves="3" result="noise" seed="3"/>
                    <feDisplacementMap in="SourceGraphic" in2="noise" scale="24" />
                </filter>
                
                <filter id="squiggly-4">
                    <feTurbulence className="turbulence" baseFrequency="0.02" numOctaves="3" result="noise" seed="4"/>
                    <feDisplacementMap in="SourceGraphic" in2="noise" scale="18" />
                </filter>
            </defs> 
        </svg>
    </div>
}